import React from "react";
import styled from "styled-components";

const NavBar = () => {
  const NavBar = styled.div``;
  const NavContainer = styled.div``;
  return (
    <NavBar>
      <NavContainer>
        <MenuList>
          <MenuItem></MenuItem>
        </MenuList>
      </NavContainer>
    </NavBar>
  );
};

export default NavBar;
